import React from "react";

function Note(props) {
  return (
    <div className="note">
      {props.MyNoteArray.map((value, index) => {
        return (
          <>
          <h1>{value.title}</h1>
          <p>{value.content}</p>
          <button>DELETE</button>
          </>
        )
      })}
    </div>
  );
}

export default Note;
